description:
Jade's boyfriend's company has just been taken over by a Russian group. She finds a job as a secretary alongside her new female colleagues. Sexy Jade is used to getting it on in the office, she quickly discovers that her new bosses are all as obsessed as she is. We soon see secretaries that fuck in the storerooms, scissor each other after hours or have orgies in the conference room.

Jade feels perfectly at ease with these new tasks and she even invites you to share a few moments of torrid exhibitionism. The POV sequences will definitely make you feel like hiring this high-end secretary.

